def clean_text(text):
  text = re.sub(r'[^가-힣ㄱ-ㅎㅏ-ㅣa-zA-Z0-9\s]', '', text) # 특수문자를 제외한 언어만 추출
  text = re.sub(r'\s+', ' ', text).strip() # 중복 공백 삭제
  return text

# 전체 문장 전처리 적용하기 - 기존의 데이터 셋에 clean_text를 이어 붙이는 형식
